import React from "react";
import Feed from "./Feed";
import "./Main.scss";

function Main() {
  return (
    <div className="contents-divider">
      <link
        href="https://fonts.googleapis.com/css2?family=Lobster&display=swap"
        rel="stylesheet"
      />
      <Feed />
    </div>
  );
}

export default Main;
